  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains basic information
  describing well logs for water wells and geothermal wells as compiled by the Virginia
  Department of Mines, Minerals and Energy, Division of Geology and Mineral Resources,
  published as a Web feature service, a Web map service, an ESRI service, and as a
  downloadable Excel spreadsheet for the National Geothermal Data System. The documents
  contain 11 worksheets, including information about the template, notes related to
  revisions of the template, Resource provider information, the data, a field list
  (data mapping view) and a worksheet with vocabularies for use in populating the
  spreadsheet (data valid terms).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
